svg.script:
  var svgns = "http://www.w3.org/2000/svg";
  var xlinkns = "http://www.w3.org/1999/xlink";
  var current = null;
  var image = "";
  var lock = false;
  var bypassed = false;
  var smilSupport = true;
  var objectCounter = 0;
  var imageCounter = 0;
  var imagesTotal = 31;
  var webkit = (window.navigator.userAgent.indexOf("WebKit") != -1);
  var sounds = new Array();
  var desc = new Array();
  desc["cubav1.jpg"] = "Exit from subterranean Indiana caves near Vinales";
  desc["cubav2.jpg"] = "Guide on tobacco plantation, close to San Juan y Martinez";
  desc["cubav3.jpg"] = "Beaches of Varadero are indeed very photogenic...";
  desc["cubav4.jpg"] = "Hundreds of funny small lizards are everywhere...";
  desc["cubav5.jpg"] = "Grand theatre and coco-taxi parking, Havana";
  desc["cubav6.jpg"] = "Ernest Hemingway in his favorite Floridita bar, Havana";
  desc["cubav7.jpg"] = "Lovely Cuban little girl in front of pharmacy, Cienfuegos";
  desc["cubav8.jpg"] = "Beautiful view from our accommodation on La Gorda, Cienfuegos";
  desc["cubav9.jpg"] = "Cock fighting is quite popular sport, El Nicho";
  desc["cubav10.jpg"] = "Cigars, bulls, old peasants and very hot sun, Quantanamo";
  desc["cubav11.jpg"] = "Watchtower for slaveholders over sugar cane fields, Trinidad";
  desc["cubav12.jpg"] = "Cuba's national bird, Tocorroro, El Ranchon Cubano";
  desc["cubav13.jpg"] = "Very interesting fish sculpture, Gibara";
  desc["cubav14.jpg"] = "Meat reselling places are just like this..., Holguin";
  desc["cubav15.jpg"] = "Day is beginning slowly in the streets of Trinidad...";
  desc["cubav16.jpg"] = "Cacao fruit in national park, Barracoa";
  desc["cubav17.jpg"] = "Heavily fortified citadel El Morro, Santiago de Cuba";
  desc["cubav18.jpg"] = "Capitol and its lively surroundings, Havana";
  desc["cubav19.jpg"] = "Santeria church and its bright wall painting, Havana";
  desc["cubah1.jpg"] = "Countryside road near picturesque Vinales";
  desc["cubah2.jpg"] = "Common way of public transport, Vinales";
  desc["cubah3.jpg"] = "World-famous and really beautiful Caribbean seashore, Varadero";
  desc["cubah4.jpg"] = "Rapidly growing mangrove trees, Cayo Las Brujas";
  desc["cubah5.jpg"] = "One of many gorgeous Cuban cars, Holguin";
  desc["cubah6.jpg"] = "Waiting for public bus is finally over, Playa La Herradura";
  desc["cubah7.jpg"] = "Beach is for everyone, including horses, pigs..., Playa La Herradura";
  desc["cubah8.jpg"] = "On the top of mysterious table mountain El Yunque, Barracoa";
  desc["cubah9.jpg"] = "Flourishing crocodile farm near Playa Larga";
  desc["cubah10.jpg"] = "Ancient but fully working train near Remedios";  
  desc["cubah11.jpg"] = "Xanadu manor golf course park, Varadero";
  desc["cubah12.jpg"] = "Grown-up iguana in fort El Morro, Santiago de Cuba";

  try {
    var test = document.createElementNS(svgns, "animateTransform");
    if (!test.beginElement) smilSupport = false;
  } catch(e) {}

  // sound manipulation method
  function sound(what) {
    var s = document.getElementById(what).cloneNode(true);
    if (s.play) {
      s.play();
      sounds.push(s);
    }
  }

  // resource preloading and demo starting method
  function checkme() {
    objectCounter++;
    if (objectCounter <= 35) document.getElementById("gl"+objectCounter).setAttribute("fill-opacity", 1);
    if (objectCounter == 35) {
      //window.setTimeout(imageShow, &preload;);
      if (smilSupport) {
        document.getElementById("loading").beginElement();
        document.getElementById("progress").firstChild.data = "...starting...";
        window.setTimeout(function() {
                            if (document.getElementById("musicSound").play) document.getElementById("musicSound").play();
                            window.setTimeout(function(){
                                                                                  if (webkit) imageShow();
                                                                                  if (document.getElementById("movingCamera")) document.getElementById("movingCamera").beginElement();
                                                                                }, 900);
                            } , &preload;);
      } else {
        document.getElementById("musicSound").play();
        var rects = document.getElementById("dominos").getElementsByTagName("rect");
        for (var i in rects) if (rects[i].setAttribute) rects[i].setAttribute("class", "tileAct");
        document.getElementById("colibri").setAttribute("transform", "translate(-225 -570)");
        document.getElementById("wholeCar").setAttribute("transform", "translate(-355 -50)");
        bypass();
      }
    }
  }

  // bypass intro helper
  function bypass() {
    bypassed = true;
    imageCounter = imagesTotal;
    document.getElementById("loadingScreen").setAttribute("display", "none");
    document.getElementById("dominos").setAttribute("transform", "scale(0.23) translate(-1280 -850)");
    document.getElementById("descTexts").setAttribute("transform", "scale(0.23) translate(340 -400)");
    var texts = document.getElementById("descTexts").getElementsByTagName("text");
    for (var i in texts) {
      if (texts[i].setAttribute) {
        texts[i].setAttribute("opacity", "1");
        texts[i].setAttribute("display", "block");
      }
    }
    document.getElementById("iniZoomer").parentNode.removeChild(document.getElementById("iniZoomer"));
    document.getElementById("iniTrans").parentNode.removeChild(document.getElementById("iniTrans"));
    document.getElementById("iniPosition").parentNode.removeChild(document.getElementById("iniPosition"));
    document.getElementById("movingCamera").parentNode.removeChild(document.getElementById("movingCamera"));
    var anims = document.getElementById("dominoEvents").getElementsByTagName("animateTransform");
    for (var i in anims) {
      //if (anims[i] && anims[i].getAttribute && anims[i].getAttribute("restart") == "whenNotActive") {
        //anims[i].setAttribute("dur", "0.1s");
        //anims[i].endElement();
        //alert(anims[i]);
        //alert(anims[i].parentNode.removeChild(anims[i]));
      //}
      if (anims[i] && anims[i].parentNode) anims[i].parentNode.removeChild(anims[i]);
    }
    var gs = document.getElementById("dominos").getElementsByTagName("g");
    for (var i in gs) if (gs[i].setAttribute) gs[i].setAttribute("display", "block");
  }

  // method playing initial domino tiles sounds; not using only genuine SMIL events because of Webkit does not supports them yet :-(
  function imageShow() {
    if (bypassed) return;
    imageCounter++;
    sound("tileSound");
    if (webkit && (imageCounter < imagesTotal)) window.setTimeout(imageShow, 1197); // it is not so much in sync, but better than nothing...
  }

  // method for showing / changing image details and descriptions
  function zoom(img, type, over) {
    if (imagesTotal > imageCounter || lock || (img == image)) return;
    if (current) {
      if (current == 1) {
        if (smilSupport) {
          document.getElementById("carOut").beginElement();
          sound("carSound");
        } else {
          document.getElementById("wholeCar").setAttribute("display", "none");
        }
      } else if (current == 2){
        if (smilSupport) {
          document.getElementById("colibriOut").beginElement();
          sound("colibriSound");
        } else {
          document.getElementById("colibri").setAttribute("display", "none");
        }
      }
      lock = true;
      current = null;
      if (smilSupport) { 
        window.setTimeout(function(){lock = false; zoom(img, type);}, &presDur;);
      } else {
        lock = false;
        zoom(img, type);
      }
      return;
    }

    if (type == 1) {
      document.getElementById("carPresenter").setAttributeNS(xlinkns, 'href', img);
      document.getElementById("description").firstChild.data = desc[img];
      if (smilSupport) {
        document.getElementById("carIn").beginElement();
      } else {
        document.getElementById("wholeCar").setAttribute("display", "block");
      }
      sound("carSound");
    } else if (type == 2) {
      document.getElementById("colibriPresenter").setAttributeNS(xlinkns, 'href', img);
      document.getElementById("description").firstChild.data = desc[img];
      if (smilSupport) {
        document.getElementById("colibriIn").beginElement();
      } else {
        document.getElementById("colibri").setAttribute("display", "block");
      }
      sound("colibriSound");
    }
    image = img;
    current = type;
    lock = true;
    window.setTimeout(function(){lock = false;}, &presDur;);
  }

  // Gecko load event workaround
  var pageImages = document.getElementById("dominos").getElementsByTagName("image");
  for (var i in pageImages) if (pageImages[i].addEventListener) pageImages[i].addEventListener("load", checkme, false);

  try { // Windows Safari without QuickTime audio/video canplaythrough event workaround
    new Audio();
  } catch (e) {
    checkme();
    checkme();
    checkme();
    checkme();
  }

  var sets = document.getElementById("dominoEvents").getElementsByTagName("set");
  for (var i in sets) {
    if (sets[i].addEventListener) sets[i].addEventListener("beginEvent", imageShow, false);
  }
  
  window.setTimeout(function(){if (objectCounter < 35) { objectCounter = 34; checkme();}}, 10000); // Gecko audio event workaround, do not wait any longer :-(
